(27, 1, '2018-09-24 13:46:50', '2018-09-24 10:46:50', '<strong>Котельники</strong> — город областного подчинения (до 2004 года — посёлок городского типа, до 2007 года — в Люберецком районе) в Московской области, городской округ. Граничит с городами Москвой, Дзержинским и Люберцами. Грузовая железнодорожная станция (Яничкино) на линии Люберцы — Дзержинский.\r\n\r\nЧисленность населения — 44 869<sup id=\"cite_ref-2018AA_3-1\" class=\"reference\"></sup> чел. (2018).', 'Котельники', '', 'publish', 'closed', 'closed', '', '%d0%ba%d0%be%d1%82%d0%b5%d0%bb%d1%8c%d0%bd%d0%b8%d0%ba%d0%b8', '', '', '2018-09-26 12:34:28', '2018-09-26 09:34:28', '', 0, 'http://localhost/?post_type=post_type_cityes&#038;p=27', 0, 'post_type_cityes', '', 0),
