(45, 1, '2018-09-25 10:07:55', '2018-09-25 07:07:55', '<img class=\"alignnone size-thumbnail wp-image-9\" src=\"http://localhost/wp-content/uploads/2018/09/408429.483xp-150x150.jpg\" alt=\"\" width=\"150\" height=\"150\" />\r\n\r\n<b><span style=\"font-family: Arial; font-size: small;\">Москва́</span></b> (произношение ) — столица Российской Федерации, город федерального значения, административный центр Центрального федерального округа и центр <b>Московской</b> области, в состав которой не входит. Крупнейший по численности населения город России и её субъект — 12 506 468 чел. (2018), самый населённый из городов, полностью расположенных в Европе, входит в первую десятку городов мира по численности населения, крупнейший русскоязычный город в мире.', 'Москва', '', 'publish', 'closed', 'closed', '', '%d0%bc%d0%be%d1%81%d0%ba%d0%b2%d0%b0', '', '', '2018-09-25 10:13:03', '2018-09-25 07:13:03', '', 0, 'http://localhost/?post_type=post_type_cityes&#038;p=45', 0, 'post_type_cityes', '', 0),
