(195, 1, '2018-09-25 16:28:16', '2018-09-25 13:28:16', '<b><span style=\"color: #222222; font-family: Arial;\">Коте́льники</span></b> — <a title=\"Город\" href=\"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4\">город</a> областного подчинения (до <a title=\"2004 год\" href=\"https://ru.wikipedia.org/wiki/2004_%D0%B3%D0%BE%D0%B4\">2004 года</a> — посёлок городского типа<sup id=\"cite_ref-gorod2004_4-0\" class=\"reference\"><a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B8#cite_note-gorod2004-4\">[4]</a></sup>, до <a title=\"2007 год\" href=\"https://ru.wikipedia.org/wiki/2007_%D0%B3%D0%BE%D0%B4\">2007 года</a> — в <a title=\"Люберецкий район\" href=\"https://ru.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%B5%D1%80%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD\">Люберецком районе</a><sup id=\"cite_ref-gorodop2007_5-0\" class=\"reference\"><a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B8#cite_note-gorodop2007-5\">[5]</a></sup>) в <a title=\"Московская область\" href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\">Московской области</a>, городской округ. Граничит с городами <a title=\"Москва\" href=\"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\">Москвой</a>, <a title=\"Дзержинский (город)\" href=\"https://ru.wikipedia.org/wiki/%D0%94%D0%B7%D0%B5%D1%80%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\">Дзержинским</a> и <a title=\"Люберцы\" href=\"https://ru.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%B5%D1%80%D1%86%D1%8B\">Люберцами</a>. Грузовая железнодорожная станция (<a class=\"mw-redirect\" title=\"Яничкино (станция)\" href=\"https://ru.wikipedia.org/wiki/%D0%AF%D0%BD%D0%B8%D1%87%D0%BA%D0%B8%D0%BD%D0%BE_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)\">Яничкино</a>) на линии <a title=\"Люберцы\" href=\"https://ru.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%B5%D1%80%D1%86%D1%8B\">Люберцы</a> — <a title=\"Дзержинский (город)\" href=\"https://ru.wikipedia.org/wiki/%D0%94%D0%B7%D0%B5%D1%80%D0%B6%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\">Дзержинский</a>.\n\nисленность населения — 44 869<sup id=\"cite_ref-2018AA_3-1\" class=\"reference\"><a href=\"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%B8#cite_note-2018AA-3\">[3]</a></sup> чел. (2018).', 'Котельники', '', 'inherit', 'closed', 'closed', '', '27-autosave-v1', '', '', '2018-09-25 16:28:16', '2018-09-25 13:28:16', '', 27, 'http://localhost/2018/09/25/27-autosave-v1/', 0, 'revision', '', 0),
(196, 1, '2018-09-25 16:36:01', '2018-09-25 13:36:01', '<strong>Люберцы</strong> — город (с 1925 года) в Московской области России, административный центр города областного подчинения Люберцы с административной территорией (до апреля 2017 года — Люберецкого района) и городского округа Люберцы (до января 2017 года — Люберецкого муниципального района)[6].\r\nЖелезнодорожный узел в 19 км к юго-востоку от Казанского вокзала. Население — 202 918 чел. (2018). Люберцы являются шестым по численности населения городом в Московской области и первым по плотности.', 'Люберцы', '', 'publish', 'closed', 'closed', '', '%d0%bb%d1%8e%d0%b1%d0%b5%d1%80%d1%86%d1%8b', '', '', '2018-09-26 12:33:24', '2018-09-26 09:33:24', '', 0, 'http://localhost/?post_type=post_type_cityes&#038;p=196', 0, 'post_type_cityes', '', 0),
